import React from 'react'


export default function Footer() {
  return (
    <div>
        <footer>
            <p style="padding-top: 0px;margin-top: 0px;">"Failure will never overtake me if my determination to succeed is strong enough."</p>
            <p style="padding-top: 0px;margin-top: 0px;">-Og Mandino-</p>



            <p class="copyright">&copy Kasthuryt 2020</p>
        </footer>
    </div>
  )
}
